  \"2015-05-26T23:12:16.392191\",\n\t\"name\": \"us-doe-nnsa-response-to-2011-fukushima-incident-at-sea-aerial-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The enclosed package represents radiation
  data collected with the fixed-wing aircraft (C-12) off the east coast of Japan on
  three separate flights dated April 5, 2011, April 18, 2011, and May 9, 2011. The
  data were collected with an array of large thallium activated sodium iodide (NaI(T))
  crystals and associated readout electronics to produce time and location referenced
  measurements.  These results represent raw data that have not been validated but
  not calibrated  to physical units. They do not include any further evaluation.\",\n\t\"license_title\":
